Queens of Jazz is a celebration of some of the greatest 
female jazz singers of the 20th century. It takes an 
unflinching and revealing look at what it actually took to 
be a jazz diva during a turbulent time in America's social 
history - a time when battle lines were being constantly 
drawn around issues of race, gender and popular culture.

This is a documentary about how these women triumphed
always at some personal cost - to become some of the greatest 
artists of the 20th century; women who chose singing above 
life itself because singing was their life.

